                  function OnClientDropDownClosing(sender, args) {
                      if (args.get_domEvent() != null) {
                          if (args.get_domEvent().target == sender.get_imageDomElement()) {
                              args.set_cancel(false);
                          }
                          else {
                              args.set_cancel(true);
