                                       <p>The Extend Content feature enables you to add customized instruction, helpful hints, or supplemental information to any page of a Module session. Its important to note that this feature does not enable you to change the existing Pitsco content.</p>
                                       <h2></h2>
                                       <h2>How to extend content</h2>
                                       <p>Click Library.</p>
                                       <p><img alt="" width="651" height="96" src="../../images/library/module-content/dashboard.png"></p>
                                       <p>Click the category of content you want to extend.</p>
                                       <p>(<strong>Note:</strong> At this time, you can only extend content for Modules, Math Modules, and Quests)</p>
                                       <p><img alt="" width="651" height="123" src="../../images/library/module-content/l2.png"></p>
                                       <p>Select the title you want to extend.</p>
                                       <p><img alt="" width="321" height="211" src="../../images/library/module-content/content dashboard_title.png"></p>
                                       <p>Click Extend.</p>
                                       <p><img alt="" width="320" height="170" src="../../images/library/module-content/l-8.png"></p>
                                       <p>To create the extended content, click Extend.</p>
                                       <p><img alt="" width="651" height="132" src="../../images/library/module-content/title_extend to create.png"></p>
                                       <p>Name the extended content and click Save.</p>
                                       <p><img alt="" width="323" height="149" src="../../images/library/module-content/name the extend content.png"></p>
                                       <p>Your Extend Content record is created. Notice there are four associated actions you can take with each record.</p>
                                       <ul>
                                          <li><strong>Rename:</strong> enables the user to rename the Extend Content record</li>
                                          <li><strong>Copy: </strong>enables the user to copy or duplicate the Extend Content record and then modify the copy for various class differences</li>
                                          <li><strong>Delete:</strong> completely removes the Extend Content record; cannot be undone</li>
                                          <li><strong>Edit:</strong> enables the user to add or edit Extend Content comments</li>
                                       </ul>
                                       <p><img alt="" width="651" height="90" src="../../images/library/module-content/extend content record.png"></p>
                                       <p>Click Edit.</p>
                                       <p>After the content loads, open the Direct Navigation panel and click the desired Session.</p>
                                       <p><img alt="" width="184" height="404" src="../../images/library/module-content/direct navigation_seession.png"></p>
                                       <p>Click the session page you want to extend.</p>
                                       <p><img alt="" width="225" height="193" src="../../images/library/module-content/direct navigation_select page.png"></p>
                                       <p>Click Extend page at the bottom of the Extend Content panel on the left side of the screen.</p>
                                       <p><img alt="" width="322" height="41" src="../../images/library/module-content/extend page button.png"></p>
                                       <p>This will activate the text field. At this point, you can enter customized instruction, helpful hints, or supplemental information. Pitsco suggests you start each Extend Content comment with a consistent prompt. Examples include but are not limited to:</p>
                                       <ul>
                                          <li><strong>DO THIS:</strong> when the instruction requires the student to do something</li>
                                          <li><strong>DID YOU KNOW?:</strong> supplemental information you want the students to learn or be aware of</li>
                                          <li><strong>CONNECTION:</strong> when the content makes a learning connection to a concept taught in another subject</li>
                                       </ul>
                                       <p>The following is an example.</p>
                                       <p><img alt="" width="322" height="149" src="../../images/library/module-content/extend content_example comment.png"></p>
                                       <p><strong>Note:</strong> A comment must be previewed in order for it to save. </p>
                                       <p>A hyperlink can also be added to enhance the Extend Content comment. To add a hyperlink, click Create hyperlink.</p>
                                       <p><img alt="" width="321" height="49" src="../../images/library/module-content/create hyperlink button.png"></p>
                                       <p>Type a title for the link; this is what the students click. Enter the web address. Click Save.</p>
                                       <p><img alt="" width="321" height="147" src="../../images/library/module-content/hyperlink information.png"></p>
                                       <p>When the students click the hyperlink, a new browser tab or window will open to the website. Click Preview to test the newly created hyperlink.</p>
                                       <p><img alt="" width="320" height="180" src="../../images/library/module-content/finished extend comment_hyperlink.png"></p>
                                       <p><strong>Note:</strong> The hyperlink can open any item that has a web address. The teacher could create his or her own supporting media (graphics, pictures, videos, audio, text, and so on) and place that on the web. If the media item has a web address, that can be used for the URL text field.</p>
